def find_max_events(events):
    events.sort(key=lambda x: x[1])
    dp = [0] * len(events)
    max_val = 0
    for i in range(len(events)):
        dp[i] = 1
        for j in range(i):
            if events[j][1] <= events[i][1] and dp[j] + 1 > dp[i]:
                dp[i] = dp[j] + 1
        max_val = max(max_val, dp[i])
    return max_val

events = [(1, 4), (3, 5), (0, 6), (5, 7), (3, 8), (5, 9), (6, 10), (8, 11), (8, 12), (2, 13), (12, 14)]
print(find_max_events(events))
